<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>LLM Screening Performance Dashboard</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: transparent;
            padding: 15px;
        }
        
        .header {
            text-align: center;
            margin-bottom: 15px;
        }
        
        .header h1 {
            color: #2c3e50;
            font-size: 1.5em;
            margin-bottom: 5px;
        }
        
        .header .subtitle {
            color: #6c757d;
            font-size: 13px;
        }
        
        .controls {
            display: flex;
            justify-content: center;
            gap: 20px;
            margin-bottom: 15px;
        }
        
        .control-group {
            display: flex;
            align-items: center;
            gap: 8px;
        }
        
        .control-group label {
            font-weight: 500;
            color: #2c3e50;
            font-size: 14px;
        }
        
        .control-group select {
            padding: 8px 12px;
            border: 2px solid #e0e0e0;
            border-radius: 8px;
            font-size: 14px;
            font-family: inherit;
            background: white;
            cursor: pointer;
            min-width: 180px;
            transition: border-color 0.2s;
        }
        
        .control-group select:hover {
            border-color: #2E86AB;
        }
        
        .control-group select:focus {
            outline: none;
            border-color: #2E86AB;
        }
        
        .dashboard-container {
            text-align: center;
        }
        
        .dashboard-img {
            max-width: 100%;
            height: auto;
        }
        
        .footer {
            text-align: center;
            margin-top: 15px;
            color: #888;
            font-size: 11px;
        }
    </style>
</head>
<body>
    <div class="header">
        <h1>ðŸ”¬ LLM Screening Performance Dashboard</h1>
        <p class="subtitle">Compare model performance across evaluation runs</p>
    </div>
    
    <div class="controls">
        <div class="control-group">
            <label for="run-select">Evaluation Run:</label>
            <select id="run-select" onchange="updateDashboard()">
                <option value="Run 1">Run 1</option>
                <option value="Run 2" selected>Run 2</option>
            </select>
        </div>
        <div class="control-group">
            <label for="model-select">Model:</label>
            <select id="model-select" onchange="updateDashboard()">
                <option value="Mistral Zero-Shot" selected>Mistral Zero-Shot</option>
                <option value="Mistral CoT">Mistral CoT</option>
                <option value="Llama 3.2 Zero-Shot">Llama 3.2 Zero-Shot</option>
                <option value="Llama 3.2 CoT">Llama 3.2 CoT</option>
            </select>
        </div>
    </div>
    
    <div class="dashboard-container">
        <img id="dashboard-img" class="dashboard-img" src="" alt="Dashboard">
    </div>
    
    <div class="footer">
        LSE-UKHSA Systematic Review Screening Project

        function updateDashboard() {
            const runSelect = document.getElementById('run-select');
            const modelSelect = document.getElementById('model-select');
            const img = document.getElementById('dashboard-img');
            
            const run = runSelect.value;
            const model = modelSelect.value;
            
            if (images[run] && images[run][model]) {
                img.src = 'data:image/png;base64,' + images[run][model];
            }
        }
        
        // Initial load
        document.addEventListener('DOMContentLoaded', function() {
            updateDashboard();
        });
    </script>
